import React, { useEffect, useState } from "react";
import { useLocation, useSearchParams } from "react-router-dom";
import { abc } from "./slabsData";
import prodImg from "../../components/assets/prod.png";
import { Fade } from "react-awesome-reveal";
import Slider from "react-slick";

function SlabsDetails() {
  useEffect(() => {
    // Scroll to the top of the page when the component mounts
    window.scrollTo(0, 0);
  }, []);

  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: true,
    fade: true,
  };

  let url = window.location.href;
  let lastIndex = url.length;
  let productId = url[lastIndex - 1];
  console.log(productId);


  const [product, SetProduct] = useState({});
  useEffect(() => {
    SetProduct(abc.data[productId]);
    if (!product) {
      return <div>Product not found</div>;
    }
    //console.log("Hello");
  }, []);

  console.log(product);

  const {
    product_name,
    description,
    primary_colour,
    vein,
    category,
    image_url,
    image_url2,
    slider_img,
    slider_img2,
    slider_img3,
  } = product;

  return (
    <div>
      <Fade duration={2000} triggerOnce>
        <section className="productSection">
          <div className="row" style={{ marginTop: "60px" }}>
            <div id="headingContainer">
              <h2 id="heading">{product_name}</h2>
            </div>
            <div className="col-lg-6" id="productPageImageContainer">

              <Slider className="imageSlider" {...settings}>
                <div>
                  <img className="slabImages" src={product.image_url2}></img>
                </div>
                <div>
                  <img className="slabImages" src={product.image_url}></img>
                </div>
              </Slider>
            </div>
            <div id="productPageDescriptionContainer" className="col-lg-6">
              <h4 style={{ fontFamily: "Raleway", margin: "10px" }}>
                {description}
              </h4>
              <div className="BorderLine"></div>

              <div className="row">
                <div className="col-lg-4">
                  <div style={{ marginLeft: "30px", marginTop: "30px" }}>
                    <h5 style={{ fontWeight: "1000", marginBottom: "20px" }}>
                      Primary colour:{" "}
                    </h5>
                    <p>{primary_colour}</p>
                    <h5 style={{ fontWeight: "1000", marginBottom: "20px" }}>
                      Vein:{" "}
                    </h5>
                    <p>{vein}</p>
                    <h5 style={{ fontWeight: "1000", marginBottom: "20px" }}>
                      Finish:{" "}
                    </h5>
                    <p>Honed</p>
                    <p>Leather</p>
                    <p>Polish</p>
                  </div>
                </div>
                <div className="col-lg-4">
                  <div style={{ marginLeft: "30px", marginTop: "30px" }}>
                    <h5 style={{ fontWeight: "1000", marginBottom: "20px" }}>
                     
                    </h5>
                    
                    <h5 > SUPER JUMBO SLAB</h5>
                    <p>Thickness: 2cm & 3 cm</p>
                    <p>Size: 138” x 78” /3500 X 2000 mm</p>
                    <br></br>
                    <h5 >JUMBO SLAB</h5>
                    <p>Thickness: 2cm & 3 cm</p>

                    <p>Size: 127” x 64” /3230 x 1630 mm</p>
                    <br></br>

                  </div>
                </div>
                <div className="col-lg-4">
                  <div style={{ marginLeft: "30px", marginTop: "30px" }}>
                    <h5 style={{ fontWeight: "1000", marginBottom: "20px" }}>
                      {" "}
                    </h5>
                    <h5 >Cut to Size</h5>
                    <p>Kitchen</p>
                    <p>Island</p>
                    <p>Backsplash</p>
                    <br></br>
                    <h5 >APPLICATIONS</h5>
                    <p>Kitchen Countertops</p>

<p>Shower Panels</p>

<p>Tubs Surrounds</p>

<p>Bathroom Vanities</p>

<p>Fireplace Surrounds</p>

<p>Bar Tops</p>

<p>Table Tops</p>

<p>Commercial Spaces</p>

                    

                  </div>
                </div>
                <div className="col-lg-4">
                  <div style={{ marginLeft: "30px", marginTop: "30px" }}></div>
                </div>
              </div>
            </div>
          </div>
        </section>
      </Fade>
    </div>
  );
}

export default SlabsDetails;
